  "Drag and drop your lab PDF here": { es: "Arrastre y suelte el PDF de su laboratorio aquí", pt: "Arraste e solte o PDF do seu laboratório aqui", de: "Ziehen Sie Ihr Labor-PDF per Drag-and-Drop hierher" , ru: "Перетащите PDF-файл лабораторной работы сюда.", zh: "将您的实验室 PDF 拖放到此处"},
