  "Import failed: this does not look like a valid LabTracker backup JSON file.": { es: "Error de importación: esto no parece un archivo JSON de copia de seguridad válido de LabTracker.", pt: "Falha na importação: não parece um arquivo JSON de backup válido do LabTracker.", de: "Import fehlgeschlagen: Dies sieht nicht nach einer gültigen LabTracker-Backup-JSON-Datei aus." , ru: "Не удалось импортировать: это не похоже на действительный JSON-файл резервной копии LabTracker.", zh: "导入失败：这看起来不像有效的 LabTracker 备份 JSON 文件。"},
  "Important: it does not mean 'good' or 'bad'; it only reflects how stable your pattern is.": { es: "Importante: no significa \"bueno\" o \"malo\"; sólo refleja cuán estable es tu patrón.", pt: "Importante: não significa ‘bom’ ou ‘ruim’; reflete apenas o quão estável é o seu padrão.", de: "Wichtig: Es bedeutet nicht „gut“ oder „schlecht“; es spiegelt nur wider, wie stabil Ihr Muster ist." , ru: "Важно: это не означает «хорошо» или «плохо»; это только отражает, насколько стабилен ваш паттерн.", zh: "重要提示：它并不意味着“好”或“坏”；它并不意味着“好”或“坏”。它只反映了你的模式有多稳定。"},
  "In plain language: this model estimates, from your own history, what will likely happen to a marker if your dose changes.": { es: "En lenguaje sencillo: este modelo estima, a partir de su propio historial, lo que probablemente le sucederá a un marcador si cambia su dosis.", pt: "Em linguagem simples: este modelo estima, a partir do seu próprio histórico, o que provavelmente acontecerá com um marcador se a sua dose mudar.", de: "Im Klartext: Dieses Modell schätzt anhand Ihrer eigenen Vorgeschichte, was wahrscheinlich mit einem Marker passieren wird, wenn sich Ihre Dosis ändert." , ru: "Говоря простым языком: эта модель оценивает, исходя из вашей собственной истории, что, скорее всего, произойдет с маркером, если ваша доза изменится.", zh: "用简单的语言来说：该模型根据您自己的历史来估计如果您的剂量发生变化，标记物可能会发生什么。"},
