  "Let AI analyze your lab values including protocol, supplements, and symptoms. Free during beta.": { es: "Deje que la IA analice sus valores de laboratorio, incluidos el protocolo, los suplementos y los síntomas. Gratis durante la beta.", pt: "Deixe a IA analisar os valores do seu laboratório, incluindo protocolo, suplementos e sintomas. Gratuito durante a versão beta.", de: "Lassen Sie die KI Ihre Laborwerte analysieren, einschließlich Protokoll, Nahrungsergänzungsmittel und Symptome. Kostenlos während der Beta." , ru: "Позвольте искусственному интеллекту анализировать ваши лабораторные показатели, включая протокол, добавки и симптомы. Бесплатно во время бета-тестирования.", zh: "让 AI 分析您的实验室数据，包括方案、补充剂和症状。测试期间免费。"},
