  "Low hematocrit may indicate depletion or anemia; discuss full blood-count context with your doctor.": { es: "Un hematocrito bajo puede indicar agotamiento o anemia; Discuta el contexto completo del hemograma con su médico.", pt: "Hematócrito baixo pode indicar depleção ou anemia; discuta o contexto completo do hemograma com seu médico.", de: "Ein niedriger Hämatokrit kann auf Erschöpfung oder Anämie hinweisen; Besprechen Sie den Zusammenhang mit dem vollständigen Blutbild mit Ihrem Arzt." , ru: "Низкий гематокрит может указывать на истощение запасов или анемию; обсудите полный анализ крови со своим врачом.", zh: "低血细胞比容可能表明衰竭或贫血；与您的医生讨论全血细胞计数情况。"},
  "Low values are often favorable; confirm this fits the broader context.": { es: "Los valores bajos suelen ser favorables; confirme que esto se ajusta al contexto más amplio.", pt: "Valores baixos são frequentemente favoráveis; confirme que isso se ajusta ao contexto mais amplo.", de: "Niedrige Werte sind oft günstig; Bestätigen Sie, dass dies in den größeren Kontext passt." , ru: "Низкие значения часто благоприятны; Подтвердите, что это соответствует более широкому контексту.", zh: "低值通常是有利的；确认这符合更广泛的背景。"},
  "Lower homocysteine is usually favorable; keep your current approach and confirm this trend at the next check.": { es: "Generalmente es favorable un nivel bajo de homocisteína; mantenga su enfoque actual y confirme esta tendencia en la próxima verificación.", pt: "A homocisteína mais baixa é geralmente favorável; mantenha sua abordagem atual e confirme esta tendência na próxima verificação.", de: "Ein niedrigerer Homocysteinspiegel ist normalerweise günstig; Behalten Sie Ihre bisherige Vorgehensweise bei und bestätigen Sie diesen Trend bei der nächsten Kontrolle." , ru: "Более низкий уровень гомоцистеина обычно благоприятен; сохраните свой нынешний подход и подтвердите эту тенденцию при следующей проверке.", zh: "较低的同型半胱氨酸通常是有利的；保持当前的方法并在下次检查时确认这一趋势。"},
  "Manage marker-name normalization without cluttering the dashboard. You can manually merge or rename markers.": { es: "Administre la normalización del nombre del marcador sin saturar el tablero. Puede fusionar o cambiar el nombre de los marcadores manualmente.", pt: "Gerencie a normalização do nome do marcador sem sobrecarregar o painel. Você pode mesclar ou renomear marcadores manualmente.", de: "Verwalten Sie die Normalisierung von Markierungsnamen, ohne das Dashboard zu überladen. Sie können Markierungen manuell zusammenführen oder umbenennen." , ru: "Управляйте нормализацией имен маркеров, не загромождая панель мониторинга. Вы можете вручную объединить или переименовать маркеры.", zh: "管理标记名称标准化，而不会使仪表板混乱。您可以手动合并或重命名标记。"},
