  "Professional blood work tracking with editable extraction and visual trends.": { es: "Seguimiento profesional de análisis de sangre con extracción editable y tendencias visuales.", pt: "Acompanhamento profissional de exames de sangue com extração editável e tendências visuais.", de: "Professionelle Blutuntersuchungsverfolgung mit bearbeitbarer Extraktion und visuellen Trends." , ru: "Профессиональное отслеживание анализа крови с редактируемым извлечением и визуальными тенденциями.", zh: "具有可编辑提取和视觉趋势的专业血液工作跟踪。"},
