  "Quick interpretation: 80-100 = fairly stable, 60-79 = moderately stable, <60 = clearly variable.": { es: "Interpretación rápida: 80-100 = bastante estable, 60-79 = moderadamente estable, <60 = claramente variable.", pt: "Interpretação rápida: 80-100 = bastante estável, 60-79 = moderadamente estável, <60 = claramente variável.", de: "Schnelle Interpretation: 80–100 = ziemlich stabil, 60–79 = mäßig stabil, <60 = deutlich variabel." , ru: "Быстрая интерпретация: 80–100 = достаточно стабильный, 60–79 = умеренно стабильный, <60 = явно вариабельный.", zh: "快速解释：80-100 = 相当稳定，60-79 = 中等稳定，<60 = 明显变化。"},
