  "Review extracted markers": { es: "Revisar marcadores extraídos", pt: "Revise os marcadores extraídos", de: "Überprüfen Sie die extrahierten Markierungen" , ru: "Просмотрите извлеченные маркеры", zh: "查看提取的标记"},
  "Rising B12 is often favorable in a recovery context; keep monitoring alongside symptoms and other B-vitamin markers.": { es: "El aumento de B12 suele ser favorable en un contexto de recuperación; Siga monitoreando junto con los síntomas y otros marcadores de vitamina B.", pt: "O aumento do B12 é muitas vezes favorável num contexto de recuperação; continue monitorando junto com os sintomas e outros marcadores de vitamina B.", de: "Ein steigender B12-Wert ist im Kontext einer Erholung oft günstig; Überwachen Sie weiterhin die Symptome und andere B-Vitamin-Marker." , ru: "Повышение уровня B12 часто благоприятно в контексте восстановления; Продолжайте следить за симптомами и другими маркерами витамина B.", zh: "维生素 B12 的升高通常有利于恢复；持续监测症状和其他 B 族维生素标志物。"},
  "Rising ferritin can fit iron-store recovery; follow the trend together with transferrin saturation.": { es: "El aumento de ferritina puede favorecer la recuperación de las reservas de hierro; sigue la tendencia junto con la saturación de transferrina.", pt: "O aumento da ferritina pode ser adequado à recuperação dos estoques de ferro; seguem a tendência juntamente com a saturação da transferrina.", de: "Ein steigender Ferritinspiegel kann zur Erholung des Eisenspeichers beitragen; Folgen Sie dem Trend zusammen mit der Transferrinsättigung." , ru: "Повышение ферритина может способствовать восстановлению запасов железа; следить за тенденцией вместе с насыщением трансферрина.", zh: "铁蛋白的升高可以促进铁储存的恢复；与转铁蛋白饱和度一起跟随趋势。"},
