  "These markers may be duplicates. Merge now or do it later in Settings > Marker Manager.": { es: "Estos marcadores pueden estar duplicados. Fusione ahora o hágalo más tarde en Configuración > Administrador de marcadores.", pt: "Esses marcadores podem ser duplicados. Mesclar agora ou faça isso mais tarde em Configurações > Gerenciador de marcadores.", de: "Bei diesen Markierungen kann es sich um Duplikate handeln. Jetzt zusammenführen oder später unter „Einstellungen“ > „Marker-Manager“ durchführen." , ru: "Эти маркеры могут быть дубликатами. Объедините сейчас или сделайте это позже в меню «Настройки» > «Диспетчер маркеров».", zh: "这些标记可能是重复的。立即合并或稍后在“设置”>“标记管理器”中进行合并。"},
  "These signals often benefit from discussion or additional monitoring.": { es: "Estas señales a menudo se benefician de una discusión o un seguimiento adicional.", pt: "Estes sinais beneficiam frequentemente de discussão ou monitorização adicional.", de: "Diese Signale profitieren häufig von einer Diskussion oder einer zusätzlichen Überwachung." , ru: "Эти сигналы часто выигрывают от обсуждения или дополнительного мониторинга.", zh: "这些信号通常受益于讨论或额外的监控。"},
  "This is a steadiness score of your core hormone markers over time (Testosterone, Estradiol, Hematocrit, SHBG).": { es: "Esta es una puntuación de estabilidad de sus marcadores hormonales principales a lo largo del tiempo (Testosterona, Estradiol, Hematocrito, SHBG).", pt: "Esta é uma pontuação de estabilidade dos seus principais marcadores hormonais ao longo do tempo (Testosterona, Estradiol, Hematócrito, SHBG).", de: "Dies ist ein Stabilitätswert Ihrer wichtigsten Hormonmarker im Zeitverlauf (Testosteron, Östradiol, Hämatokrit, SHBG)." , ru: "Это показатель стабильности ваших основных гормональных маркеров с течением времени (тестостерон, эстрадиол, гематокрит, ГСПГ).", zh: "这是您的核心激素标记物随时间变化的稳定性得分（睾酮、雌二醇、血细胞比容、性激素结合球蛋白）。"},
  "This tool is for personal tracking only and does not provide medical advice.": { es: "Esta herramienta es únicamente para seguimiento personal y no proporciona asesoramiento médico.", pt: "Esta ferramenta serve apenas para rastreamento pessoal e não fornece aconselhamento médico.", de: "Dieses Tool dient ausschließlich der persönlichen Nachverfolgung und stellt keine medizinische Beratung dar." , ru: "Этот инструмент предназначен только для личного отслеживания и не предоставляет медицинских консультаций.", zh: "该工具仅用于个人追踪，不提供医疗建议。"},
  "This trend appears favorable; continue monitoring with consistent sampling timing.": { es: "Esta tendencia parece favorable; Continuar el monitoreo con tiempos de muestreo consistentes.", pt: "Esta tendência parece favorável; continue monitorando com um tempo de amostragem consistente.", de: "Dieser Trend erscheint günstig; Setzen Sie die Überwachung mit konsistentem Probenahmezeitpunkt fort." , ru: "Эта тенденция представляется благоприятной; продолжать мониторинг с постоянным соблюдением сроков отбора проб.", zh: "这种趋势似乎是有利的；以一致的采样时间继续监测。"},
  "This updates all reports containing this marker.": { es: "Esto actualiza todos los informes que contienen este marcador.", pt: "Isso atualiza todos os relatórios que contêm esse marcador.", de: "Dadurch werden alle Berichte aktualisiert, die diese Markierung enthalten." , ru: "При этом будут обновлены все отчеты, содержащие этот маркер.", zh: "这将更新包含此标记的所有报告。"},
