  "Track your bloodwork. Upload PDFs, spot trends, optimize your protocol — all data stays in your browser.": { es: "Siga sus análisis de sangre. Cargue PDF, detecte tendencias y optimice su protocolo: todos los datos permanecen en su navegador.", pt: "Acompanhe seus exames de sangue. Envie PDFs, identifique tendências e otimize seu protocolo — todos os dados permanecem no seu navegador.", de: "Verfolgen Sie Ihre Blutwerte. Laden Sie PDFs hoch, erkennen Sie Trends und optimieren Sie Ihr Protokoll – alle Daten bleiben in Ihrem Browser.", ru: "Отслеживайте свои анализы крови. Загружайте PDF, замечайте тенденции и оптимизируйте протокол — все данные остаются в вашем браузере.", zh: "追踪您的血液检测。上传 PDF、发现趋势并优化方案 - 所有数据都保留在您的浏览器中。"},
