  "Values or trends that currently look favorable are shown here in green.": { es: "Los valores o tendencias que actualmente parecen favorables se muestran aquí en verde.", pt: "Os valores ou tendências que atualmente parecem favoráveis ​​são mostrados aqui em verde.", de: "Werte oder Trends, die derzeit günstig erscheinen, werden hier grün dargestellt." , ru: "Значения или тенденции, которые в настоящее время выглядят благоприятными, показаны здесь зеленым цветом.", zh: "当前看起来有利的值或趋势在此处以绿色显示。"},
  "We need a few more test results with a known weekly dose before we can show reliable estimates here.": { es: "Necesitamos algunos resultados de pruebas más con una dosis semanal conocida antes de que podamos mostrar estimaciones confiables aquí.", pt: "Precisamos de mais alguns resultados de testes com uma dose semanal conhecida antes de podermos mostrar aqui estimativas confiáveis.", de: "Wir benötigen noch ein paar Testergebnisse bei bekannter Wochendosis, bevor wir hier verlässliche Schätzungen zeigen können." , ru: "Нам нужно еще несколько результатов тестов с известной недельной дозой, прежде чем мы сможем представить здесь надежные оценки.", zh: "在我们可以在这里显示可靠的估计之前，我们需要更多已知每周剂量的测试结果。"},
