  "In plain language: what likely changed after each protocol change, how reliable that signal is, and what else may have influenced it.": { es: "En lenguaje sencillo: qué cambió probablemente después de cada cambio de protocolo, cuán confiable es esa señal y qué más pudo influir.", pt: "Em linguagem simples: o que provavelmente mudou após cada mudança de protocolo, quão confiável é esse sinal e o que mais pode ter influenciado.", de: "In klarer Sprache: Was hat sich nach jeder Protokolländerung wahrscheinlich verändert, wie zuverlässig ist dieses Signal und was könnte es sonst beeinflusst haben?" , ru: "Простым языком: что, вероятно, изменилось после каждого изменения протокола, насколько надежен этот сигнал и что еще могло на него повлиять.", zh: "用简单的语言来说：每次协议更改后可能会发生什么变化，该信号的可靠性如何，以及其他可能影响它的因素。"},
  "This shows likely associations, not hard causality or medical advice.": { es: "Esto muestra asociaciones probables, no causalidad estricta ni consejo médico.", pt: "Isso mostra associações prováveis, não causalidade rígida nem aconselhamento médico.", de: "Dies zeigt wahrscheinliche Zusammenhänge, keine harte Kausalität und keine medizinische Beratung." , ru: "Это указывает на вероятные ассоциации, а не на явную причинно-следственную связь или медицинские рекомендации.", zh: "这显示了可能的关联，而不是硬性因果关系或医疗建议。"},
  "You have an active report review. If you leave this section, unsaved changes will be lost.": { es: "Tienes una revisión de informe activa. Si abandona esta sección, los cambios no guardados se perderán.", pt: "Você tem uma revisão de relatório ativa. Se você sair desta seção, as alterações não salvas serão perdidas.", de: "Sie haben eine aktive Berichtsüberprüfung. Wenn Sie diesen Abschnitt verlassen, gehen nicht gespeicherte Änderungen verloren." , ru: "У вас есть активная проверка отчета. Если вы покинете этот раздел, несохраненные изменения будут потеряны.", zh: "您有一个活跃的报告审核。如果您离开此部分，未保存的更改将会丢失。"},
