  "Always verify marker name, value, and reference range before saving. OCR/AI can make minor mistakes.": { es: "Verifique siempre el nombre del marcador, el valor y el rango de referencia antes de guardar. OCR/AI puede cometer errores menores.", pt: "Sempre verifique o nome, o valor e o intervalo de referência do marcador antes de salvar. OCR/AI pode cometer pequenos erros.", de: "Überprüfen Sie vor dem Speichern immer den Markernamen, den Wert und den Referenzbereich. OCR/KI kann kleinere Fehler machen." , ru: "Перед сохранением всегда проверяйте имя, значение и опорный диапазон маркера. OCR/AI может допускать незначительные ошибки.", zh: "保存前务必验证标记名称、值和参考范围。 OCR/AI 可能会犯一些小错误。" },
  "Always verify marker name, value, and reference range before saving. Text-only parsing can still make mistakes.": { es: "Verifique siempre el nombre del marcador, el valor y el rango de referencia antes de guardar. El análisis de sólo texto aún puede cometer errores.", pt: "Sempre verifique o nome, o valor e o intervalo de referência do marcador antes de salvar. A análise somente de texto ainda pode cometer erros.", de: "Überprüfen Sie vor dem Speichern immer den Markernamen, den Wert und den Referenzbereich. Bei der reinen Textanalyse können immer noch Fehler auftreten." , ru: "Перед сохранением всегда проверяйте имя, значение и опорный диапазон маркера. Анализ только текста все еще может допускать ошибки.", zh: "保存前务必验证标记名称、值和参考范围。纯文本解析仍然会出错。" },
  "Parser warnings were detected.": { es: "Se detectaron advertencias del analizador.", pt: "Avisos do analisador foram detectados.", de: "Parser-Warnungen wurden erkannt." , ru: "Обнаружены предупреждения парсера.", zh: "检测到解析器警告。" },
  "Continue": { es: "Continuar", pt: "Continuar", de: "Weitermachen" , ru: "Продолжать", zh: "继续" },
  "Consent for external AI": { es: "Consentimiento para IA externa", pt: "Consentimento para IA externa", de: "Einwilligung für externe KI" , ru: "Согласие на внешний ИИ", zh: "同意外部人工智能" },
  "Your data stays local unless you grant consent below. Choose what to include for AI analysis.": { es: "Sus datos permanecen locales a menos que usted otorgue su consentimiento a continuación. Elija qué incluir para el análisis de IA.", pt: "Seus dados permanecem locais, a menos que você conceda o consentimento abaixo. Escolha o que incluir para análise de IA.", de: "Ihre Daten bleiben lokal, es sei denn, Sie erteilen unten Ihre Einwilligung. Wählen Sie aus, was in die KI-Analyse einbezogen werden soll." , ru: "Ваши данные останутся локальными, если вы не дадите согласие ниже. Выберите, что включить в анализ ИИ.", zh: "除非您在下面授予同意，否则您的数据将保留在本地。选择 AI 分析要包含的内容。" },
  "Your data stays local unless you grant consent below. Choose what we may send externally to improve extraction for this PDF.": { es: "Sus datos permanecen locales a menos que usted otorgue su consentimiento a continuación. Elija lo que podemos enviar externamente para mejorar la extracción de este PDF.", pt: "Seus dados permanecem locais, a menos que você conceda o consentimento abaixo. Escolha o que podemos enviar externamente para melhorar a extração deste PDF.", de: "Ihre Daten bleiben lokal, es sei denn, Sie erteilen unten Ihre Einwilligung. Wählen Sie aus, was wir extern senden dürfen, um die Extraktion für dieses PDF zu verbessern." , ru: "Ваши данные останутся локальными, если вы не дадите согласие ниже. Выберите, что мы можем отправить внешним пользователям, чтобы улучшить извлечение этого PDF-файла.", zh: "除非您在下面授予同意，否则您的数据将保留在本地。选择我们可以向外部发送的内容以改进此 PDF 的提取。" },
  "What do we send?": { es: "¿Qué enviamos?", pt: "O que enviamos?", de: "Was versenden wir?" , ru: "Что мы отправляем?", zh: "我们发送什么？" },
  "Use AI to improve extraction": { es: "Utilice IA para mejorar la extracción", pt: "Use IA para melhorar a extração", de: "Nutzen Sie KI, um die Extraktion zu verbessern" , ru: "Используйте ИИ для улучшения добычи", zh: "使用 AI 改进提取" },
  "Send full PDF too (this run only)": { es: "Envíe también el PDF completo (solo esta ejecución)", pt: "Envie PDF completo também (somente nesta execução)", de: "Senden Sie auch die vollständige PDF-Datei (nur bei diesem Lauf)" , ru: "Отправьте также полный PDF-файл (только в этом выпуске)", zh: "也发送完整的 PDF（仅此运行）" },
  "By default we send only redacted text. Sending the full PDF is optional and applies only to this one attempt.": { es: "De forma predeterminada, enviamos solo texto redactado. Enviar el PDF completo es opcional y se aplica únicamente a este intento.", pt: "Por padrão, enviamos apenas texto redigido. O envio do PDF completo é opcional e aplica-se apenas a esta tentativa.", de: "Standardmäßig versenden wir nur redigierten Text. Das Senden der vollständigen PDF-Datei ist optional und gilt nur für diesen einen Versuch." , ru: "По умолчанию мы отправляем только отредактированный текст. Отправка полного PDF-файла не является обязательной и применима только к этой единственной попытке.", zh: "默认情况下，我们仅发送经过编辑的文本。发送完整的 PDF 是可选的，并且仅适用于这一次尝试。" },
  "Include symptoms": { es: "Incluir síntomas", pt: "Incluir sintomas", de: "Beziehen Sie Symptome mit ein" , ru: "Включить симптомы", zh: "包括症状" },
  "Include notes": { es: "incluir notas", pt: "Incluir notas", de: "Fügen Sie Notizen hinzu" , ru: "Включить примечания", zh: "包括注释" },
  "Symptoms and notes are off by default and only sent if you enable them here.": { es: "Los síntomas y las notas están desactivados de forma predeterminada y solo se envían si los habilita aquí.", pt: "Os sintomas e as notas estão desativados por padrão e só serão enviados se você ativá-los aqui.", de: "Symptome und Notizen sind standardmäßig deaktiviert und werden nur gesendet, wenn Sie sie hier aktivieren." , ru: "По умолчанию симптомы и примечания отключены и отправляются только в том случае, если вы включите их здесь.", zh: "默认情况下，症状和注释处于关闭状态，仅当您在此处启用它们时才会发送。" },
  "Without consent, nothing is sent externally.": { es: "Sin consentimiento, no se envía nada al exterior.", pt: "Sem consentimento, nada é enviado externamente.", de: "Ohne Einwilligung wird nichts nach außen verschickt." , ru: "Без согласия ничего не отправляется наружу.", zh: "未经同意，不会向外部发送任何内容。" },
