  "Inside latest reference range": { es: "Dentro del último rango de referencia", pt: "Dentro do intervalo de referência mais recente", de: "Innerhalb des neuesten Referenzbereichs" , ru: "Внутри последнего эталонного диапазона", zh: "在最新参考范围内" },
  "Outside latest reference range": { es: "Fuera del último rango de referencia", pt: "Fora do intervalo de referência mais recente", de: "Außerhalb des neuesten Referenzbereichs" , ru: "За пределами последнего эталонного диапазона", zh: "超出最新参考范围" },
  "Falls inside the optimal zone": { es: "Cae dentro de la zona óptima", pt: "Cai dentro da zona ideal", de: "Fällt in den optimalen Bereich" , ru: "Попадает в оптимальную зону", zh: "落在最佳区域内" },
  "Falls inside the longevity zone": { es: "Cae dentro de la zona de longevidad.", pt: "Cai dentro da zona de longevidade", de: "Fällt in die Langlebigkeitszone" , ru: "Попадает в зону долголетия", zh: "落在长寿区内" },
  "Outside known target zones": { es: "Fuera de las zonas objetivo conocidas", pt: "Fora das zonas-alvo conhecidas", de: "Außerhalb bekannter Zielzonen" , ru: "За пределами известных целевых зон", zh: "在已知目标区域之外" },
