  "Likely range": { es: "rango probable", pt: "Intervalo provável", de: "Wahrscheinliche Reichweite" , ru: "Вероятный диапазон", zh: "可能的范围" },
  "Zone impact": { es: "Impacto de la zona", pt: "Impacto da zona", de: "Zoneneinfluss" , ru: "Воздействие зоны", zh: "区域影响" },
  "Note:": { es: "Nota:", pt: "Observação:", de: "Notiz:" , ru: "Примечание:", zh: "笔记：" },
  "This prediction is based on population study averages only — not your personal measurement data. Individual dose-response varies significantly. Use this as a rough reference only.": { es: "Esta predicción se basa únicamente en promedios de estudios de población, no en sus datos de medición personales. La dosis-respuesta individual varía significativamente. Utilice esto sólo como referencia aproximada.", pt: "Esta previsão é baseada apenas em médias de estudos populacionais – e não em seus dados de medição pessoais. A resposta individual à dose varia significativamente. Use isso apenas como uma referência aproximada.", de: "Diese Vorhersage basiert nur auf Durchschnittswerten aus Bevölkerungsstudien – nicht auf Ihren persönlichen Messdaten. Die individuelle Dosis-Wirkungs-Beziehung variiert erheblich. Verwenden Sie dies nur als grobe Referenz." , ru: "Этот прогноз основан только на средних показателях демографических исследований, а не на данных ваших личных измерений. Индивидуальная доза-реакция значительно варьируется. Используйте это только как приблизительную ссылку.", zh: "此预测仅基于人口研究平均值，而不是您的个人测量数据。个体剂量反应差异很大。仅将此作为粗略参考。" },
  "Hybrid model:": { es: "Modelo híbrido:", pt: "Modelo híbrido:", de: "Hybridmodell:" , ru: "Гибридная модель:", zh: "混合模型：" },
  "This model blends your own measurement data with population study averages, because you don't yet have enough personal data points for a fully personal model. Add more lab results to improve accuracy.": { es: "Este modelo combina sus propios datos de medición con promedios de estudios de población, porque aún no tiene suficientes puntos de datos personales para un modelo completamente personal. Agregue más resultados de laboratorio para mejorar la precisión.", pt: "Este modelo combina seus próprios dados de medição com médias de estudos populacionais, porque você ainda não possui pontos de dados pessoais suficientes para um modelo totalmente pessoal. Adicione mais resultados de laboratório para melhorar a precisão.", de: "Dieses Modell kombiniert Ihre eigenen Messdaten mit Durchschnittswerten aus Bevölkerungsstudien, da Sie noch nicht über genügend persönliche Datenpunkte für ein vollständig persönliches Modell verfügen. Fügen Sie weitere Laborergebnisse hinzu, um die Genauigkeit zu verbessern." , ru: "Эта модель объединяет ваши собственные данные измерений со средними значениями исследования населения, поскольку у вас еще недостаточно личных данных для полностью индивидуальной модели. Добавьте больше результатов лабораторных исследований, чтобы повысить точность.", zh: "该模型将您自己的测量数据与人口研究平均值相结合，因为您还没有足够的个人数据点来构建完全个人的模型。添加更多实验室结果以提高准确性。" },
  "Model details": { es: "Detalles del modelo", pt: "Detalhes do modelo", de: "Modelldetails" , ru: "Детали модели", zh: "型号详情" },
  "model": { es: "modelo", pt: "modelo", de: "Modell" , ru: "модель", zh: "模型" },
  "Sampling warning": { es: "Advertencia de muestreo", pt: "Aviso de amostragem", de: "Probenahmewarnung" , ru: "Предупреждение о выборке", zh: "采样警告" },
  "offline fallback": { es: "respaldo sin conexión", pt: "substituto off-line", de: "Offline-Fallback" , ru: "автономный резерв", zh: "离线后备" },
  "The model estimate is above your last measurement at the same dose — your last test may have been taken before reaching steady-state at this dose level.": { es: "La estimación del modelo está por encima de su última medición con la misma dosis; es posible que su última prueba se haya realizado antes de alcanzar el estado estable en este nivel de dosis.", pt: "A estimativa do modelo está acima da sua última medição com a mesma dose – o seu último teste pode ter sido realizado antes de atingir o estado estacionário neste nível de dose.", de: "Die Modellschätzung liegt über Ihrer letzten Messung bei derselben Dosis. Möglicherweise wurde Ihr letzter Test durchgeführt, bevor bei dieser Dosis der Steady-State erreicht wurde." , ru: "Оценка модели превышает ваше последнее измерение при той же дозе — ваш последний тест мог быть проведен до достижения устойчивого состояния при этом уровне дозы.", zh: "模型估计值高于您上次在相同剂量下的测量值 - 您的上次测试可能是在该剂量水平达到稳态之前进行的。" },
  "Compare local result with AI result": { es: "Comparar el resultado local con el resultado de IA", pt: "Compare o resultado local com o resultado da IA", de: "Vergleichen Sie das lokale Ergebnis mit dem KI-Ergebnis" , ru: "Сравните локальный результат с результатом AI", zh: "将本地结果与AI结果进行比较" },
  "Review what AI found or changed, then choose which version you want to keep.": { es: "Revise lo que la IA encontró o cambió y luego elija qué versión desea conservar.", pt: "Revise o que a IA encontrou ou alterou e escolha qual versão você deseja manter.", de: "Überprüfen Sie, was die KI gefunden oder geändert hat, und wählen Sie dann aus, welche Version Sie behalten möchten." , ru: "Просмотрите, что ИИ нашел или изменил, а затем выберите, какую версию вы хотите сохранить.", zh: "查看 AI 发现或更改的内容，然后选择要保留的版本。" },
