  "This PDF has no usable text layer. OCR was used; review extracted markers carefully.": { es: "Este PDF no tiene ninguna capa de texto utilizable. Se utilizó OCR; Revise cuidadosamente los marcadores extraídos.", pt: "Este PDF não possui camada de texto utilizável. OCR foi utilizado; revise os marcadores extraídos cuidadosamente.", de: "Dieses PDF hat keine verwendbare Textebene. OCR wurde verwendet; Überprüfen Sie die extrahierten Markierungen sorgfältig." , ru: "В этом PDF-файле нет пригодного для использования текстового слоя. использовалось OCR; внимательно просмотрите извлеченные маркеры.", zh: "此 PDF 没有可用的文本图层。使用了OCR；仔细检查提取的标记。" },
  "Text extraction failed for this PDF. The app switched to a safe fallback.": { es: "La extracción de texto falló para este PDF. La aplicación cambió a un respaldo seguro.", pt: "Falha na extração de texto para este PDF. O aplicativo mudou para um substituto seguro.", de: "Die Textextraktion für dieses PDF ist fehlgeschlagen. Die App hat auf einen sicheren Fallback umgestellt." , ru: "Не удалось извлечь текст для этого PDF-файла. Приложение перешло в безопасный резервный режим.", zh: "此 PDF 的文本提取失败。该应用程序切换到安全后备。" },
  "OCR could not be started for this file. Add missing markers manually.": { es: "No se pudo iniciar el OCR para este archivo. Agregue los marcadores que faltan manualmente.", pt: "Não foi possível iniciar o OCR para este arquivo. Adicione marcadores ausentes manualmente.", de: "OCR konnte für diese Datei nicht gestartet werden. Fehlende Markierungen manuell hinzufügen." , ru: "Не удалось запустить OCR для этого файла. Добавьте недостающие маркеры вручную.", zh: "无法为此文件启动 OCR。手动添加缺失的标记。" },
  "OCR was only partially successful. Some markers may be missing or incorrect.": { es: "El OCR sólo tuvo un éxito parcial. Es posible que algunos marcadores falten o sean incorrectos.", pt: "OCR foi apenas parcialmente bem-sucedido. Alguns marcadores podem estar faltando ou incorretos.", de: "OCR war nur teilweise erfolgreich. Möglicherweise fehlen einige Markierungen oder sind falsch." , ru: "OCR удалось лишь частично. Некоторые маркеры могут отсутствовать или быть неправильными.", zh: "OCR 仅部分成功。某些标记可​​能丢失或不正确。" },
  "Parser confidence is low. Check date, marker values, and reference ranges before saving.": { es: "La confianza del analizador es baja. Verifique la fecha, los valores de los marcadores y los rangos de referencia antes de guardar.", pt: "A confiança do analisador é baixa. Verifique a data, os valores dos marcadores e os intervalos de referência antes de salvar.", de: "Das Vertrauen des Parsers ist gering. Überprüfen Sie vor dem Speichern Datum, Markierungswerte und Referenzbereiche." , ru: "Доверие парсера низкое. Перед сохранением проверьте дату, значения маркеров и контрольные диапазоны.", zh: "解析器置信度较低。保存前检查日期、标记值和参考范围。" },
  "Unknown lab format detected. Review extraction manually or retry OCR.": { es: "Se detectó un formato de laboratorio desconocido. Revise la extracción manualmente o vuelva a intentar el OCR.", pt: "Formato de laboratório desconhecido detectado. Revise a extração manualmente ou tente novamente o OCR.", de: "Unbekanntes Laborformat erkannt. Überprüfen Sie die Extraktion manuell oder wiederholen Sie die OCR." , ru: "Обнаружен неизвестный лабораторный формат. Проверьте извлечение вручную или повторите попытку распознавания.", zh: "检测到未知的实验室格式。手动检查提取或重试 OCR。" },
  "AI refinement was skipped by your cost settings. You can run manual improve if needed.": { es: "Su configuración de costos omitió el refinamiento de la IA. Puede ejecutar una mejora manual si es necesario.", pt: "O refinamento da IA ​​foi ignorado pelas configurações de custo. Você pode executar a melhoria manual, se necessário.", de: "Die KI-Verfeinerung wurde von Ihren Kosteneinstellungen übersprungen. Bei Bedarf können Sie eine manuelle Verbesserung durchführen." , ru: "Уточнение ИИ было пропущено вашими настройками затрат. При необходимости вы можете запустить улучшение вручную.", zh: "您的成本设置跳过了 AI 优化。如果需要，您可以运行手动改进。" },
  "AI text-only extraction found too few marker rows. The parser attempted extra rescue steps when possible.": { es: "La extracción de solo texto por IA encontró muy pocas filas de marcadores. El analizador intentó medidas de rescate adicionales cuando fue posible.", pt: "A extração somente de texto da IA ​​encontrou poucas linhas de marcadores. O analisador tentou etapas extras de resgate quando possível.", de: "Die reine Textextraktion der KI hat zu wenige Markierungszeilen gefunden. Der Parser versuchte nach Möglichkeit zusätzliche Rettungsschritte." , ru: "Извлечение только текста с помощью ИИ обнаружило слишком мало строк маркеров. Анализатор, когда это возможно, предпринял дополнительные шаги по спасению.", zh: "AI 仅文本提取发现标记行太少。解析器在可能的情况下尝试额外的救援步骤。" },
