  "PDF has no usable text layer.": { es: "El PDF no tiene ninguna capa de texto utilizable.", pt: "PDF não possui camada de texto utilizável.", de: "PDF hat keine verwendbare Textebene." , ru: "PDF не имеет пригодного для использования текстового слоя.", zh: "PDF 没有可用的文本层。" },
  "Only a few markers were found.": { es: "Sólo se encontraron unos pocos marcadores.", pt: "Apenas alguns marcadores foram encontrados.", de: "Es wurden nur wenige Markierungen gefunden." , ru: "Было обнаружено всего несколько маркеров.", zh: "仅发现了一些标记。" },
  "Parser confidence is very low.": { es: "La confianza del analizador es muy baja.", pt: "A confiança do analisador é muito baixa.", de: "Das Vertrauen des Parsers ist sehr gering." , ru: "Доверие парсера очень низкое.", zh: "解析器的置信度非常低。" },
  "Confidence and unit coverage are low.": { es: "La confianza y la cobertura de la unidad son bajas.", pt: "A confiança e a cobertura da unidade são baixas.", de: "Vertrauen und Einheitenabdeckung sind gering." , ru: "Доверие и охват подразделений низкие.", zh: "信心和单位覆盖率较低。" },
  "Parser is uncertain about this report": { es: "El analizador no está seguro acerca de este informe.", pt: "O analisador não tem certeza sobre este relatório", de: "Parser ist sich über diesen Bericht nicht sicher" , ru: "Парсер не уверен в этом отчете", zh: "解析器对此报告不确定" },
  "You can continue with the local result, or let AI try an extra pass.": { es: "Puedes continuar con el resultado local o dejar que la IA intente un pase extra.", pt: "Você pode continuar com o resultado local ou deixar a IA tentar uma passagem extra.", de: "Sie können mit dem lokalen Ergebnis fortfahren oder die KI einen zusätzlichen Durchgang versuchen lassen." , ru: "Вы можете продолжить с локальным результатом или позволить ИИ попробовать дополнительный проход.", zh: "您可以继续使用本地结果，或者让 AI 尝试额外的传递。" },
  "Why uncertain?": { es: "¿Por qué incierto?", pt: "Por que incerto?", de: "Warum unsicher?" , ru: "Почему неопределенный?", zh: "为什么不确定？" },
  "Unit coverage": { es: "Cobertura unitaria", pt: "Cobertura da unidade", de: "Einheitenabdeckung" , ru: "Покрытие единицы", zh: "单位覆盖范围" },
  "Nothing is sent externally until you explicitly grant consent in the next step.": { es: "No se envía nada externamente hasta que usted otorgue su consentimiento explícitamente en el siguiente paso.", pt: "Nada é enviado externamente até que você conceda consentimento explicitamente na próxima etapa.", de: "Es erfolgt keine externe Übermittlung, bis Sie im nächsten Schritt Ihre ausdrückliche Einwilligung erteilen." , ru: "Ничего не отправляется извне, пока вы явно не дадите согласие на следующем шаге.", zh: "在您在下一步中明确授予同意之前，不会向外部发送任何内容。" },
  "Not now (keep local)": { es: "Ahora no (mantener local)", pt: "Agora não (mantenha local)", de: "Nicht jetzt (lokal bleiben)" , ru: "Не сейчас (сохраняйте локальность)", zh: "现在不行（保持本地化）" },
