  "Quick view of how your wellbeing changes across check-ins.": { es: "Vista rápida de cómo cambia su bienestar a lo largo de los registros.", pt: "Visualização rápida de como seu bem-estar muda durante os check-ins.", de: "Schneller Überblick darüber, wie sich Ihr Wohlbefinden bei jedem Check-in verändert." , ru: "Быстрый просмотр того, как меняется ваше самочувствие при регистрации.", zh: "快速查看您的健康状况在办理入住期间的变化情况。" },
