  "Last check-in: yesterday": { es: "Último check-in: ayer", pt: "Último check-in: ontem", de: "Letzter Check-in: gestern" , ru: "Последний заезд: вчера", zh: "最后入住时间：昨天" },
  "Wellbeing check-in": { es: "Registro de bienestar", pt: "Check-in de bem-estar", de: "Wohlfühl-Check-in" , ru: "Регистрация благополучия", zh: "健康检查" },
  "Time for a new check-in": { es: "Es hora de un nuevo check-in", pt: "Hora de um novo check-in", de: "Zeit für einen neuen Check-in" , ru: "Время новой регистрации", zh: "是时候进行新的签到了" },
  "On track": { es: "En camino", pt: "No caminho certo", de: "Auf dem richtigen Weg" , ru: "На ходу", zh: "步入正轨" },
  "Latest average": { es: "Último promedio", pt: "Média mais recente", de: "Aktueller Durchschnitt" , ru: "Последнее среднее значение", zh: "最新平均值" },
