  "See what is likely to change per relevant marker when your testosterone dose changes.": { es: "Vea qué es probable que cambie según el marcador relevante cuando cambie su dosis de testosterona.", pt: "Veja o que provavelmente mudará por marcador relevante quando sua dose de testosterona mudar.", de: "Sehen Sie, was sich pro relevantem Marker wahrscheinlich ändern wird, wenn sich Ihre Testosterondosis ändert." , ru: "Посмотрите, что может измениться по соответствующему маркеру при изменении дозы тестостерона.", zh: "了解当您的睾酮剂量发生变化时，每个相关标记可能会发生什么变化。" },
  "Model how your markers are likely to respond when your dose changes.": { es: "Modele cómo es probable que respondan sus marcadores cuando cambie su dosis.", pt: "Modele como seus marcadores provavelmente respondem quando sua dose muda.", de: "Modellieren Sie, wie Ihre Marker wahrscheinlich reagieren, wenn sich Ihre Dosis ändert." , ru: "Смоделируйте, как ваши маркеры, вероятно, отреагируют при изменении дозы.", zh: "模拟当剂量变化时您的指标可能如何响应。" },
  "Educational aid for doctor discussion, not a medical prescription.": { es: "Ayuda educativa para la discusión con el médico, no una receta médica.", pt: "Auxílio educacional para discussão médica, não uma receita médica.", de: "Aufklärungshilfe für Arztgespräche, kein ärztliches Rezept." , ru: "Образовательная помощь для обсуждения врачом, а не медицинского рецепта.", zh: "用于医生讨论的教育援助，而不是医疗处方。" },
  "In view: {focus} relevant markers out of {total} total.": { es: "En vista: {focus} marcadores relevantes de {total} en total.", pt: "Em exibição: {focus} marcadores relevantes de {total} no total.", de: "Im Blick: {focus} relevante Marker von insgesamt {total}." , ru: "В поле зрения: {focus} релевантных маркеров из {total} всего.", zh: "当前显示：{total} 个中有 {focus} 个相关指标。" },
  "Relevant markers in focus": { es: "Marcadores relevantes en foco", pt: "Marcadores relevantes em foco", de: "Relevante Markierungen im Fokus" , ru: "Соответствующие маркеры в фокусе", zh: "相关标记成为焦点" },
