  "Dose scenario (mg/week)": { es: "Escenario de dosis (mg/semana)", pt: "Cenário de dose (mg/semana)", de: "Dosisszenario (mg/Woche)" , ru: "Сценарий дозы (мг/неделю)", zh: "剂量方案（毫克/周）" },
