  "Without persistent consent, we show a consent check before each run.": { es: "Sin un consentimiento persistente, mostramos una verificación de consentimiento antes de cada ejecución.", pt: "Sem consentimento persistente, mostramos uma verificação de consentimento antes de cada execução.", de: "Ohne dauerhafte Einwilligung zeigen wir vor jedem Lauf eine Einwilligungsprüfung an." , ru: "Без постоянного согласия мы показываем проверку согласия перед каждым запуском.", zh: "如果没有持久同意，我们会在每次运行前显示同意检查。" },
  "By default processing stays local on your device. Only after opt-in do we send required fields to external AI.": { es: "De forma predeterminada, el procesamiento permanece local en su dispositivo. Solo después de aceptar enviamos los campos obligatorios a una IA externa.", pt: "Por padrão, o processamento permanece local no seu dispositivo. Somente após a aceitação é que enviamos os campos obrigatórios para IA externa.", de: "Standardmäßig bleibt die Verarbeitung lokal auf Ihrem Gerät. Erst nach der Einwilligung senden wir erforderliche Felder an externe KI." , ru: "По умолчанию обработка остается локальной на вашем устройстве. Только после согласия мы отправляем обязательные поля внешнему AI.", zh: "默认情况下，处理保留在您设备的本地。只有在选择加入后，我们才会将必填字段发送给外部人工智能。" },
